/**
 * Centralized Configuration Manager
 * Loads environment-specific configuration from .env files
 */
const fs = require('fs');
const path = require('path');
const dotenv = require('dotenv');

class ConfigManager {
  constructor() {
    this.config = {};
    this.loadConfig();
  }

  /**
   * Load configuration based on environment
   */
  loadConfig() {
    // Determine which environment to use
    const env = process.env.NODE_ENV || 'dev';

    // Load base config from .env.example
    this.loadEnvFile('.env.example');

    // Load environment-specific config
    this.loadEnvFile(`.env.${env}`);

    // Load local overrides if they exist
    this.loadEnvFile('.env');

    // Process the loaded environment variables
    this.processConfig();
  }

  /**
   * Load environment variables from a file
   * @param {string} filename 
   */
  loadEnvFile(filename) {
    const filePath = path.resolve(process.cwd(), filename);

    if (fs.existsSync(filePath)) {
      const envConfig = dotenv.parse(fs.readFileSync(filePath));

      // Merge with existing config
      for (const key in envConfig) {
        process.env[key] = envConfig[key];
      }
    }
  }

  /**
   * Process loaded environment variables into structured config
   */
  processConfig() {
    this.config = {
      env: process.env.ENV || 'dev',

      salesforce: {
        username: process.env.SF_USERNAME,
        password: process.env.SF_PASSWORD,
        url: process.env.SF_URL,
        orgAlias: process.env.SF_ORG_ALIAS,
        apiVersion: process.env.SF_API_VERSION,
        instanceUrl: process.env.SF_INSTANCE_URL
      },

      orangeHrm: {
        url: process.env.ORANGE_HRM_URL,
        username: process.env.ORANGE_HRM_USERNAME,
        password: process.env.ORANGE_HRM_PASSWORD
      },

      output: {
        pagesDir: process.env.PAGES_OUTPUT_DIR || './src/pages',
        testsDir: process.env.TESTS_OUTPUT_DIR || './tests/pages',
        elementsFile: process.env.ELEMENTS_OUTPUT_FILE || './temp/sf_elements.json',
        sessionFile: process.env.SF_SESSION_FILE || './sessions/sf_session.txt',
        authStorageDir: process.env.AUTH_STORAGE_DIR || './auth'
      },

      browser: {
        headless: process.env.HEADLESS === 'true',
        slowMo: parseInt(process.env.BROWSER_SLOW_MO || '0'),
        timeout: parseInt(process.env.BROWSER_TIMEOUT || '30000')
      },

      test: {
        defaultTimeout: parseInt(process.env.DEFAULT_TIMEOUT || '30000'),
        actionTimeout: parseInt(process.env.ACTION_TIMEOUT || '15000'),
        expectTimeout: parseInt(process.env.EXPECT_TIMEOUT || '5000'),
        screenshotOnFailure: process.env.SCREENSHOT_ON_FAILURE === 'true',
        retryCount: parseInt(process.env.RETRY_COUNT || '0')
      }
    };
  }

  /**
   * Get the entire configuration
   * @returns {Object} The complete configuration object
   */
  getConfig() {
    return this.config;
  }

  /**
   * Get a specific configuration section
   * @param {string} section The configuration section to retrieve
   * @returns {Object} The requested configuration section
   */
  getSection(section) {
    return this.config[section] || {};
  }

  /**
   * Get a specific configuration value
   * @param {string} section The configuration section
   * @param {string} key The configuration key
   * @param {*} defaultValue Default value if not found
   * @returns {*} The configuration value
   */
  getValue(section, key, defaultValue = null) {
    const sectionObj = this.getSection(section);
    return sectionObj[key] !== undefined ? sectionObj[key] : defaultValue;
  }
}

// Create and export a singleton instance
const configManager = new ConfigManager();
module.exports = configManager;

/**
 * API-UI Combined Tests V2
 * 
 * Enhanced tests that combine API and UI interactions with improved error handling
 */
const { test, expect } = require('@playwright/test');
const { ApiClient, RestUtils } = require('../../utils/api');
const { WebInteractions } = require('../../utils/web/webInteractions');
const { DataGenerator } = require('../../utils/data/dataGenerator');
const { PlaywrightErrorHandler } = require('../../utils/common/errorHandler');
const config = require('../../config');

// Read base URLs from environment or config
const baseUrl = process.env.BASE_URL || config.baseUrl;
const apiBaseUrl = process.env.API_BASE_URL || config.api?.baseUrl;
const loginPath = process.env.LOGIN_PATH || config.paths?.login;
const dashboardPath = process.env.DASHBOARD_PATH || config.paths?.dashboard;

// Read credentials from environment or config
const username = process.env.USERNAME || config.credentials?.username;
const password = process.env.PASSWORD || config.credentials?.password;

// Read selectors from environment or config
const selectors = {
  usernameInput: process.env.USERNAME_INPUT || config.selectors?.combined?.usernameInput,
  passwordInput: process.env.PASSWORD_INPUT || config.selectors?.combined?.passwordInput,
  loginButton: process.env.LOGIN_BUTTON || config.selectors?.combined?.loginButton,
  pimLink: process.env.PIM_LINK || config.selectors?.combined?.pimLink,
  adminLink: process.env.ADMIN_LINK || config.selectors?.combined?.adminLink,
  searchInput: process.env.SEARCH_INPUT || config.selectors?.combined?.searchInput,
  searchButton: process.env.SEARCH_BUTTON || config.selectors?.combined?.searchButton,
  employeeTable: process.env.EMPLOYEE_TABLE || config.selectors?.combined?.employeeTable,
  addButton: process.env.ADD_BUTTON || config.selectors?.combined?.addButton,
  userRoleDropdown: process.env.USER_ROLE_DROPDOWN || config.selectors?.combined?.userRoleDropdown,
  employeeNameInput: process.env.EMPLOYEE_NAME_INPUT || config.selectors?.combined?.employeeNameInput,
  statusDropdown: process.env.STATUS_DROPDOWN || config.selectors?.combined?.statusDropdown,
  usernameField: process.env.USERNAME_FIELD || config.selectors?.combined?.usernameField,
  passwordField: process.env.PASSWORD_FIELD || config.selectors?.combined?.passwordField,
  saveButton: process.env.SAVE_BUTTON || config.selectors?.combined?.saveButton
};

test.describe('API-UI Combined Tests V2', () => {
  let apiClient;
  let webInteractions;
  let dataGenerator;
  let authToken;

  test.beforeEach(async ({ page, request }) => {
    // Initialize utilities
    apiClient = new ApiClient(apiBaseUrl);
    webInteractions = new WebInteractions(page);
    dataGenerator = new DataGenerator();

    // Navigate to the login page
    await page.goto(`${baseUrl}${loginPath}`);

    // Intercept network requests to capture auth token
    await page.route('**/api/v2/auth/login', async route => {
      // Continue the request
      await route.continue();
      // Get the response
      const response = await route.request().response();
      const responseBody = await response.json();
      // Store the token
      authToken = responseBody?.data?.access_token || '';

      // Set auth token for API client
      if (authToken) {
        apiClient.setAuthToken(authToken);
      }
    });

    // Login with error handling
    await PlaywrightErrorHandler.withRetry(async () => {
      await webInteractions.fillForm({
        [selectors.usernameInput]: username,
        [selectors.passwordInput]: password
      });
      await webInteractions.click(selectors.loginButton);

      // Wait for dashboard to load
      await page.waitForURL(`**${dashboardPath}`);
    }, { maxRetries: 2, retryDelay: 1000 });
  });

  test('should create user via UI and verify via API', async ({ page, request }) => {
    // Skip if no auth token
    test.skip(!authToken, 'Auth token not captured');

    // Generate random user data
    const userData = {
      username: dataGenerator.username(),
      password: dataGenerator.password(),
      employeeName: 'Paul Collings', // Using existing employee
      userRole: 'ESS',
      status: 'Enabled'
    };

    // Navigate to Admin page
    await webInteractions.click(selectors.adminLink);

    // Click Add button
    await webInteractions.click(selectors.addButton);

    // Wait for form to load
    await page.waitForSelector('.oxd-form');

    // Fill the form with self-healing locators
    await PlaywrightErrorHandler.withSelfHealing(async (selector) => {
      // Select User Role
      await page.locator(selector).first().click();
      await page.getByRole('option', { name: userData.userRole }).click();
    }, {
      selector: selectors.userRoleDropdown,
      alternativeSelectors: ['.oxd-select-wrapper input', '.oxd-select-text-input']
    });

    // Enter Employee Name
    await webInteractions.fill(selectors.employeeNameInput, userData.employeeName.split(' ')[0]);
    await page.waitForTimeout(1000); // Wait for suggestions
    await page.getByText(userData.employeeName).click();

    // Select Status
    await PlaywrightErrorHandler.withSelfHealing(async (selector) => {
      await page.locator(selector).nth(1).click();
      await page.getByRole('option', { name: userData.status }).click();
    }, {
      selector: selectors.userRoleDropdown,
      alternativeSelectors: ['.oxd-select-wrapper input', '.oxd-select-text-input']
    });

    // Enter Username and Password
    await webInteractions.fill(selectors.usernameField, userData.username);
    await webInteractions.fillForm({
      [selectors.passwordField]: userData.password,
      [selectors.passwordField + ':nth-child(2)']: userData.password
    });

    // Save the form
    await webInteractions.click(selectors.saveButton);

    // Wait for success (redirect back to users list)
    await page.waitForURL('**/admin/viewSystemUsers');

    // Verify via API that the user was created
    const responseData = await apiClient.get('/v2/admin/users', {
      params: {
        username: userData.username
      }
    });

    // Verify API response
    expect(responseData.data).toBeDefined();
    expect(responseData.data.length).toBeGreaterThan(0);

    // Find the created user
    const createdUser = responseData.data.find(user => user.username === userData.username);
    expect(createdUser).toBeDefined();
    expect(createdUser.userRole.name).toBe(userData.userRole);
    expect(createdUser.status).toBe(userData.status === 'Enabled' ? true : false);
  });

  test('should update employee via API and verify changes in UI', async ({ page, request }) => {
    // Skip if no auth token
    test.skip(!authToken, 'Auth token not captured');

    // First, get an existing employee via API
    const employeesData = await apiClient.get('/v2/pim/employees');

    // Skip if no employees found
    test.skip(!employeesData.data || employeesData.data.length === 0, 'No employees found');

    // Get the first employee
    const employee = employeesData.data[0];
    const employeeId = employee.empNumber;

    // Generate updated data
    const updatedData = {
      firstName: dataGenerator.firstName(),
      lastName: dataGenerator.lastName(),
      middleName: dataGenerator.firstName()
    };

    // Update employee via API with error handling
    const updateData = await PlaywrightErrorHandler.withRetry(async () => {
      return await apiClient.put(`/v2/pim/employees/${employeeId}`, updatedData);
    }, { maxRetries: 2, retryDelay: 1000 });

    // Navigate to PIM page to verify updated employee in UI
    await webInteractions.click(selectors.pimLink);

    // Search for the employee with performance measurement
    await PlaywrightErrorHandler.withPerformanceMeasurement(async () => {
      await webInteractions.fill(selectors.searchInput, `${updatedData.firstName} ${updatedData.lastName}`);
      await webInteractions.click(selectors.searchButton);

      // Wait for search results
      await page.waitForSelector(selectors.employeeTable);
    }, 'Employee Search');

    // Verify employee is found with updated data
    const employeeRow = page.locator(selectors.employeeTable).first();
    await expect(employeeRow).toContainText(updatedData.firstName);
    await expect(employeeRow).toContainText(updatedData.lastName);
  });
});

/**
 * API Utilities Index
 * 
 * Exports all API utilities for easy importing
 */

const ApiClient = require('./apiClient');
const AuthUtils = require('./auth');
const GraphQLUtils = require('./graphqlUtils');
const RestUtils = require('./restUtils');
const { SchemaValidator } = require('./schemaValidator');

// Models
const Employee = require('./models/Employee');
const User = require('./models/User');

module.exports = {
  ApiClient,
  AuthUtils,
  GraphQLUtils,
  RestUtils,
  SchemaValidator,
  models: {
    Employee,
    User
  }
};

/**
 * API Client
 * 
 * Consolidated API client that combines functionality from apiRequest.js and apiUtils.js
 */
const { request } = require('@playwright/test');

/**
 * API Client for making HTTP requests
 */
class ApiClient {
  /**
   * Constructor
   * @param {string} baseUrl - Base URL for API requests
   * @param {Object} options - Additional options for API requests
   */
  constructor(baseUrl, options = {}) {
    this.baseUrl = baseUrl;
    this.options = options;
    this.defaultHeaders = options.headers || {
      'Content-Type': 'application/json',
      'Accept': 'application/json'
    };
    this.requestContext = null;
  }

  /**
   * Initialize the API request context
   * @returns {Promise<void>}
   */
  async init() {
    if (!this.requestContext) {
      this.requestContext = await request.newContext({
        baseURL: this.baseUrl,
        extraHTTPHeaders: this.defaultHeaders,
        ...this.options
      });
    }
  }

  /**
   * Format URL with path
   * @param {string} path - API path
   * @returns {string} Full URL
   */
  formatUrl(path) {
    // Handle paths that already have a protocol
    if (path.startsWith('http://') || path.startsWith('https://')) {
      return path;
    }

    // Ensure path starts with / if baseUrl doesn't end with /
    if (this.baseUrl && !this.baseUrl.endsWith('/') && !path.startsWith('/')) {
      path = `/${path}`;
    }

    return path;
  }

  /**
   * Make a GET request
   * @param {string} path - URL path
   * @param {Object} options - Request options
   * @returns {Promise<Object>} Response data
   */
  async get(path, options = {}) {
    await this.init();
    const url = this.formatUrl(path);

    // Handle query parameters
    const params = options.params || {};
    const queryParams = new URLSearchParams();
    for (const [key, value] of Object.entries(params)) {
      queryParams.append(key, value);
    }

    const queryString = queryParams.toString();
    const fullUrl = queryString ? `${url}${url.includes('?') ? '&' : '?'}${queryString}` : url;

    const response = await this.requestContext.get(fullUrl, options);
    return await this.handleResponse(response);
  }

  /**
   * Make a POST request
   * @param {string} path - URL path
   * @param {Object} data - Request body
   * @param {Object} options - Request options
   * @returns {Promise<Object>} Response data
   */
  async post(path, data, options = {}) {
    await this.init();
    const url = this.formatUrl(path);

    const requestOptions = {
      ...options,
      data
    };

    const response = await this.requestContext.post(url, requestOptions);
    return await this.handleResponse(response);
  }

  /**
   * Make a PUT request
   * @param {string} path - URL path
   * @param {Object} data - Request body
   * @param {Object} options - Request options
   * @returns {Promise<Object>} Response data
   */
  async put(path, data, options = {}) {
    await this.init();
    const url = this.formatUrl(path);

    const requestOptions = {
      ...options,
      data
    };

    const response = await this.requestContext.put(url, requestOptions);
    return await this.handleResponse(response);
  }

  /**
   * Make a PATCH request
   * @param {string} path - URL path
   * @param {Object} data - Request body
   * @param {Object} options - Request options
   * @returns {Promise<Object>} Response data
   */
  async patch(path, data, options = {}) {
    await this.init();
    const url = this.formatUrl(path);

    const requestOptions = {
      ...options,
      data
    };

    const response = await this.requestContext.patch(url, requestOptions);
    return await this.handleResponse(response);
  }

  /**
   * Make a DELETE request
   * @param {string} path - URL path
   * @param {Object} options - Request options
   * @returns {Promise<Object>} Response data
   */
  async delete(path, options = {}) {
    await this.init();
    const url = this.formatUrl(path);

    const response = await this.requestContext.delete(url, options);
    return await this.handleResponse(response);
  }

  /**
   * Handle API response
   * @param {import('@playwright/test').APIResponse} response - API response
   * @returns {Promise<Object>} Processed response data
   * @private
   */
  async handleResponse(response) {
    const contentType = response.headers()['content-type'] || '';
    const status = response.status();

    // For successful responses
    if (response.ok()) {
      if (contentType.includes('application/json')) {
        return await response.json();
      } else {
        return await response.text();
      }
    }

    // For error responses
    const error = new Error(`API request failed with status ${status}`);
    error.status = status;
    error.response = response;

    try {
      if (contentType.includes('application/json')) {
        error.data = await response.json();
      } else {
        error.data = await response.text();
      }
    } catch (e) {
      error.data = null;
    }

    throw error;
  }

  /**
   * Set auth token for requests
   * @param {string} token - Auth token
   * @param {string} scheme - Auth scheme (default: Bearer)
   */
  setAuthToken(token, scheme = 'Bearer') {
    this.defaultHeaders['Authorization'] = `${scheme} ${token}`;
  }

  /**
   * Dispose the API request context
   * @returns {Promise<void>}
   */
  async dispose() {
    if (this.requestContext) {
      await this.requestContext.dispose();
      this.requestContext = null;
    }
  }
}

module.exports = ApiClient;

/**
 * Authentication utility for API testing
 * 
 * Supports both:
 * - Static API key header (via API_KEY)
 * - OAuth2 client credential flow (via OAUTH_CLIENT_ID, OAUTH_CLIENT_SECRET)
 */

/**
 * Authentication utilities for API testing
 */
class AuthUtils {
  /**
   * Constructor
   */
  constructor() {
    // Load base credentials from environment variables
    this.apiKey = process.env.API_KEY || null;
    this.tokenUrl = process.env.OAUTH_TOKEN_URL || null;
    this.clientId = process.env.OAUTH_CLIENT_ID || process.env.XRAY_CLIENT_ID;
    this.clientSecret = process.env.OAUTH_CLIENT_SECRET || process.env.XRAY_CLIENT_SECRET;
    this.oauthToken = null;
  }

  /**
   * Fetches a new OAuth2 token using the client credential flow
   * @returns {Promise<string>} OAuth token
   */
  async getOAuthToken() {
    if (!this.tokenUrl || !this.clientId || !this.clientSecret) {
      throw new Error(
        'Missing OAuth credentials. Ensure OAUTH_TOKEN_URL, CLIENT_ID, and CLIENT_SECRET are set in .env'
      );
    }

    const response = await fetch(this.tokenUrl, {
      method: 'POST',
      headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
      body: `grant_type=client_credentials&client_id=${this.clientId}&client_secret=${this.clientSecret}`
    });

    if (!response.ok) {
      const errorMessage = `OAuth2 authentication failed: ${response.status} ${response.statusText}`;
      throw new Error(errorMessage);
    }

    const data = await response.json();
    this.oauthToken = data.access_token;
    return this.oauthToken;
  }

  /**
   * Returns a basic API key header
   * @returns {Object} API key headers
   */
  getApiKeyHeaders() {
    if (!this.apiKey) {
      throw new Error('API_KEY not set. Define it in your .env file.');
    }

    return {
      'x-api-key': this.apiKey
    };
  }

  /**
   * Returns the Authorization header using the fetched OAuth token
   * @returns {Object} OAuth headers
   */
  getOAuthHeaders() {
    if (!this.oauthToken) {
      throw new Error('OAuth token not initialized. Call getOAuthToken() first.');
    }

    return {
      Authorization: `Bearer ${this.oauthToken}`
    };
  }
}

module.exports = AuthUtils;

/**
 * GraphQL Utilities for API testing
 * 
 * Note: This module requires the graphql-request package.
 * If not installed, run: npm install graphql-request
 */

/**
 * GraphQL Utilities class for making GraphQL requests
 */
class GraphQLUtils {
  /**
   * Constructor
   * @param {string} endpoint - GraphQL endpoint
   * @param {Object} headers - Request headers
   */
  constructor(endpoint, headers = {}) {
    this.endpoint = endpoint;
    this.headers = {
      'Content-Type': 'application/json',
      ...headers,
    };

    // Check if graphql-request is available
    try {
      const { request, gql } = require('graphql-request');
      this.request = request;
      this.gql = gql;
    } catch (error) {
      console.warn('graphql-request package not found. GraphQL functionality will be limited.');
      this.request = null;
      this.gql = (strings, ...values) => strings.map((str, i) => str + (values[i] || '')).join('');
    }
  }

  /**
   * Set authorization header
   * @param {string} token - Authorization token
   * @param {string} type - Token type (e.g., Bearer)
   * @returns {GraphQLUtils} This instance for chaining
   */
  setAuthToken(token, type = 'Bearer') {
    this.headers['Authorization'] = `${type} ${token}`;
    return this;
  }

  /**
   * Execute a GraphQL query
   * @param {string} query - GraphQL query
   * @param {Object} variables - Query variables
   * @returns {Promise<Object>} Query result
   */
  async query(query, variables = {}) {
    if (!this.request) {
      throw new Error('graphql-request package is required. Install it with: npm install graphql-request');
    }

    try {
      console.log('Executing GraphQL query', { query, variables });

      const data = await this.request({
        url: this.endpoint,
        document: this.gql`${query}`,
        variables,
        requestHeaders: this.headers,
      });

      console.log('GraphQL query result', { data });
      return data;
    } catch (error) {
      console.error('GraphQL query failed', error);
      throw error;
    }
  }

  /**
   * Execute a GraphQL mutation
   * @param {string} mutation - GraphQL mutation
   * @param {Object} variables - Mutation variables
   * @returns {Promise<Object>} Mutation result
   */
  async mutate(mutation, variables = {}) {
    return this.query(mutation, variables);
  }

  /**
   * Execute a GraphQL request using fetch API (fallback)
   * @param {string} query - GraphQL query or mutation
   * @param {Object} variables - Variables
   * @returns {Promise<Object>} Result
   */
  async fetchGraphQL(query, variables = {}) {
    try {
      const response = await fetch(this.endpoint, {
        method: 'POST',
        headers: this.headers,
        body: JSON.stringify({
          query,
          variables
        })
      });

